import { precompileTemplate } from "@ember/template-compilation";
export default precompileTemplate("{{#if this.readOnly}}\n  <button class=\"btn btn-default disabled\" title={{I18n \"admin.site_settings.mandatory_group\"}}>{{this.itemName}}</button>\n{{else}}\n  <button {{on \"click\" (fn this.selectKit.deselect this.item)}} aria-label={{i18n \"select_kit.delete_item\" name=this.itemName}} data-value={{this.itemValue}} data-name={{this.itemName}} type=\"button\" id=\"{{this.id}}-choice\" class=\"btn btn-default selected-choice {{this.extraClass}}\">\n    {{d-icon \"xmark\"}}\n    {{#if (has-block)}}\n      {{yield}}\n    {{else}}\n      <span class=\"d-button-label\">\n        {{this.itemName}}\n      </span>\n    {{/if}}\n  </button>\n{{/if}}", {
  moduleName: "select-kit/components/selected-choice.hbs"
});